import * as Progress from 'react-native-progress';
import { StyleSheet} from 'react-native';

const progressBarStyles = StyleSheet.create({
    bar: {
        height: 10,
        flexDirection: "row",
        borderColor: '#000',
        borderWidth: 2,
        borderRadius: 5
    },
});
export {progressBarStyles};
